css:
.command-logger {
  width: 100%;
  height: 100%;
  overflow: auto;
}
.command-logger .summary {
  text-align: center;
  padding-bottom: 10px;
}
body.command-logger-node-text {
  background-color: transparent;
}
body.command-logger-node-text div {
  display: table-cell;
  vertical-align: middle;
  text-align: center;
  cursor: pointer;
}
body.command-logger-node-text span {
  -webkit-user-select: none;
}
